import React from "react";
import ReactDOM from "react-dom";

// CSS
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";

// Import Components
import App from "./App";
import Main from "./Main";

ReactDOM.render(
  <>
    <App />
    <Main />
  </>,
  document.getElementById("root")
);
